import React from 'react';
import {Link} from 'react-router-dom';
import './NavBar.css';

const NavBar = () => {
    return(
        <div className="header">
            <div className="logo">
                <ul>
                    <li><Link to="/">Home</Link></li>
                </ul>
            </div>
            <div className="menu">
                <ul>
                    <li id="menu-link"><Link to="/recipes">Recipes</Link></li>
                    <li className="menu-link-new"><Link to="/new-recipe">+ New Recipe</Link></li>
                </ul>
            </div>
        </div>
    )
}

export default NavBar;
